import React from 'react'
import "../styles/Home.scss"

const Home = () => {
  return (
    <div className='home'>
        <main>
        <h1>React Solutions</h1>
        <p1>Concept demo for future react projects</p1>
        </main>
    </div>
  )
}

export default Home
